import ItemsPage from "./Items";
import Home from "../App";
import { Route, Routes, BrowserRouter } from "react-router-dom";

function Pages() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/" element={<App />} />
        <Route path="/items" element={<ItemsPage />} />
      </Routes>
    </BrowserRouter>
  );
}

export default Pages;
